import './Register.css';
import { createUser } from '../service.js';
import apis from '../api/index';
import axios from 'axios'

import { Link } from 'react-router-dom';
import { useState } from "react";

function Register() {

    const[email, setEmail] = useState("");
    const[password, setPassword] = useState("");
    const[message, setMessage] = useState("result here");

    function insertUser(e){ 
        e.preventDefault();
        var user = {
            username: email,
            email: email
        }
        axios({
            method: "post",
            url: "http://localhost:3080/server/newuser",
            data: user,
            headers: { "Content-Type": "multipart/form-data" },
          })
            .then(function (response) {
              //handle success
              console.log(response);
            })
            .catch(function (response) {
              //handle error
              console.log(response);
            });
    }

    return(
        <div>
            <form id="login-form" >
                <div class="mb-3">
                    <label class="form-label">Email address</label>
                    <input type="email" class="form-control" required onChange={(event) => setEmail(event.target.value)}></input>
                </div>
                <div class="mb-3">
                    <label for="inputPassword5" class="form-label">Password</label>
                    <input type="password" class="form-control" required onChange={(event) => setPassword(event.target.value)}></input>
                </div>
                <button type="button" class="btn btn-primary mx-auto d-block" onSubmit={() => insertUser()}>Register</button>
                <p>{message}</p>
                <Link to="/login">Login</Link>
            </form>
        </div>
    )
}

export default Register;
